import React from 'react'
import Navigation from '../Navigation'
import { Router, Route, Switch } from 'react-router'

export default class Main extends React.Component {
    constructor(){
        super()
    }

    render(){
        return(
            <div>
                <Navigation />
                <span> This is the main page! </span>
            </div>
        )
    }
}
